Release information:  


Game of Thrones - A Telltale Games Series is a six part episodic
game series set in the world of HBO's groundbreaking TV show. This
new story tells of House Forrester, a noble family from the north
of Westeros, loyal to the Starks of Winterfell. Caught up in the
events surrounding the War of the Five Kings, they are thrown into
a maelstrom of bloody warfare, revenge, intrigue, and horror as
they fight to survive while the seven kingdoms tear themselves
apart.

For more infos go to : http://store.steampowered.com/app/330840/

Installation Information:

- Extract
- Burn or mount the .iso
- Run setup.exe and install
- Copy crack from CODEX dir to installdir
- Play

All previous Episodes are included

General Notes:

- Block the game's exe in your firewall to prevent the game from
trying to go online ..
- If you install games to your systemdrive, it may be necessary
to run this game with admin privileges instead

